  input: TEXT,F5A,,"With this October Quarterly filing, the Fund fulfills its requirement
    to file its Form 5 electronically.  Please note, however, that this filing appears
    as an amended report solely due to difficulties encountered in filing a timely
    48 hour notice on September 5, 2003.  The Electronic Division staff of the Commission
    had advised the Fund to designate our 48 hour notice as an October Quarterly filing,
    because the FEC was unable to accommodate the electronic filing of that 48-hour
    report. Now, we must designate this actual October Quarterly filing as an amended
    report in order to upload it to the FEC via the Internet.  Additionally, we now
    must use the same coverage dates disclosed on our 48 hour notice (7/28/03-9/30/03)
    for this filing.  Please note that there were no reportable expenditures before
    7/27/03.  We are using the FEC electronic filing specifications, and we continue
    to work with the FEC to insure its ability to accurately receive the electronic
    version of this and future Form5 filings."
